import Button from "../Button";
import Clock from "./Clock";

export default function Stopwatch() {
  return (
    <>
      <div>
        <p>Chose a card and start the chronometer</p>
        <div>
          <Clock />
        </div>
        <Button>
          Start!
        </Button>
      </div>
    </>
  )
}
